import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import HomePage from "./pages/HomePage";
import './App.css';

class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Switch>
            <Route exact path="/" render={props => (
              <HomePage
                currentPage="home"
              />
			    	)}/>
          </Switch>
        </Router>
      </div>
    );
  }
}

export default App;
